import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";
import Login from "./container/login";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/">
          <Login />
        </Route>
      </Routes>
    </BrowserRouter>
  );
};

export default App;
